import Link from 'next/link';

export default function Index() {
  return (
    <div>

      <div className="home-menu">

        <div className="main-box">
          <h2>Destress</h2>
          <p>Relax with meditation</p>
        </div>
        <div className="main-box">
          <h2>Organise</h2>
          <p>Schedule your time</p>
        </div>
        <div className="main-box">
          <h2>Reach Out</h2>
          <p>Find help</p>
        </div>
        <div className="main-box">
          <h2>Choco Project</h2>
          <p>Join the community</p>
        </div>

      </div>

    <style jsx>{`

      .home-menu {
        overflow: hidden;
        top: 0;
        right: 0;
        background: beige;
        display: block;
        width: 100%;
      }

      .main-box { 
        background: #FBF3E8; 
        width: 54vw;
        margin-left: 5vw;
        margin-right: 3vw;
        margin-bottom: 5vw;
        float: left;
        position: relative;
        top: 35px;
        padding: 2%;
        padding-left: 5%;
        padding-top: 3%;
        height: 50vw;
        display: block;
      }

      h2 { 
        font-family: Raleway; 
        font-weight: bold; 
        font-size: 300%; 
        color: #4488F4; 
      }

      p {
        font-family: Montserrat;
        font-size: 150%;
      }

    `}</style>

    </div>
  );
}
